import React, { useState, useEffect, useRef } from "react";
import analysis from "../images/medical-analysis.jpeg"
const { tableau } = window;


function Scenario2(){
  const url = 'https://public.tableau.com/views/Medical_16847518861770/Dashboard2';
  const ref = useRef(null);

  const initViz = () => {
    new tableau.Viz(ref.current, url, {
      width: "100%",
      height: "100%"
    });
  };

  useEffect(initViz, []);

  return (
    <div className="embed">
      <h1 className="embed_heading">Medical expenditure rates in Melbourne</h1>
      <div className="viz-container" ref={ref} />
      <div className="content">
      <h1 className="content_heading">Scenario Analysis</h1>
       <div className="image-container">
          <img className="image" src={analysis} alt="Image 1" />
          <p className="image-description">The results of this analysis suggest that there is a positive correlation between average sentiment and average expenditure on Medicare per person. For instance, we observe that places like Hastings, Mount Martha that have average expenditure of about 102.38 have positive sentiments towards healthcare expenditure as compared to Suburbs such as Bundoora and St Albans that have lesser expenditure on healthcare but have negative sentiments around healthcare. This implies two things. It could either mean that Melbourne is still the most livable city or more research and factors must be taken into consideration to validate the hypothesis. Bundoora – 69.04,-0.071, St Albans – 86.85,  -0.060 , Weribee – 62.54, 0, Hastings -  102.38, 0.33,3934 – 102.38, 0.061. The results of this analysis shows that there is a positive correlation between average sentiment and average expenditure on Medicare per person suggesting that people are happy to pay more as long as they are getting better health care services.</p>
      </div> 
      </div>
    </div>
  );
}


export default Scenario2;
